import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  Container, Typography, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Box, CircularProgress
} from '@mui/material';
import './Hcss.css';

function UserHeartDiseaseHistory() {
  const [historyData, setHistoryData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [clicked, setClicked] = useState(false);

  useEffect(() => {
    axios.get('http://localhost:5000/history-heart-disease')
      .then(response => {
        setHistoryData(response.data);
        setLoading(false);
      })
      .catch(error => {
        console.error('Error fetching history:', error);
        // Optionally redirect to login or show an error message
      });
  }, []);

  const handleClick = () => {
    setClicked(!clicked);
  };

  if (loading) return (
    <Container maxWidth="lg" sx={{ mt: 5, textAlign: 'center' }}>
      <CircularProgress />
      <Typography variant="h6" sx={{ mt: 2 }}>Loading...</Typography>
    </Container>
  );

  return (
    <>
      <nav className="navbar-admin">
        <a href="#" className="navbar-logo">
          <svg id="logo-15" 
              width="49" 
              height="48" 
              viewBox="0 0 49 48" 
              fill="none" 
              xmlns="http://www.w3.org/2000/svg"> 
            <path d="M24.5 12.75C24.5 18.9632 19.4632 24 13.25 24H2V12.75C2 6.53679 7.03679 1.5 13.25 1.5C19.4632 1.5 24.5 6.53679 24.5 12.75Z" className="ccustom" fill="#17CF97"></path> 
            <path d="M24.5 35.25C24.5 29.0368 29.5368 24 35.75 24H47V35.25C47 41.4632 41.9632 46.5 35.75 46.5C29.5368 46.5 24.5 41.4632 24.5 35.25Z" className="ccustom" fill="#17CF97"></path> 
            <path d="M2 35.25C2 41.4632 7.03679 46.5 13.25 46.5H24.5V35.25C24.5 29.0368 19.4632 24 13.25 24C7.03679 24 2 29.0368 2 35.25Z" className="ccustom" fill="#17CF97"></path>
            <path d="M47 12.75C47 6.53679 41.9632 1.5 35.75 1.5H24.5V12.75C24.5 18.9632 29.5368 24 35.75 24C41.9632 24 47 18.9632 47 12.75Z" className="ccustom" fill="#17CF97"></path>
          </svg>
        </a>
        <div>
          <ul id="navbar" className={clicked ? "active" : ""}>
            <li><a className="active" href="/userAcc">Back</a></li>
            <li><a href="/login">Log Out</a></li>
          </ul>
        </div>
        <div id="mobile" onClick={handleClick}>
          <i id="bar" className={clicked ? 'fas fa-times' : 'fas fa-bars'}></i>
        </div>
      </nav>
      <Container maxWidth="lg">
        <Box sx={{ mt: 5, mb: 3 }}>
          <Typography variant="h3" align="center" gutterBottom>
            Heart Disease Prediction History
          </Typography>
        </Box>

        <TableContainer component={Paper} sx={{ maxHeight: 600 }}>
          <Table stickyHeader>
            <TableHead>
              <TableRow>
                <TableCell><strong>Date</strong></TableCell>
                <TableCell><strong>Age</strong></TableCell>
                <TableCell><strong>Sex</strong></TableCell>
                <TableCell><strong>Chest Pain Type</strong></TableCell>
                <TableCell><strong>Cholesterol</strong></TableCell>
                <TableCell><strong>MaxHR</strong></TableCell>
                <TableCell><strong>Result</strong></TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {historyData.length === 0 ? (
                <TableRow>
                  <TableCell colSpan={7} align="center">No records found</TableCell>
                </TableRow>
              ) : (
                historyData.map((record, index) => (
                  <TableRow key={index}>
                    <TableCell>{new Date(record.date).toLocaleString()}</TableCell>
                    <TableCell>{record.Age}</TableCell>
                    <TableCell>{record.Sex === '1' ? 'Male' : 'Female'}</TableCell>
                    <TableCell>{record.ChestPainType}</TableCell>
                    <TableCell>{record.Cholesterol}</TableCell>
                    <TableCell>{record.MaxHR}</TableCell>
                    <TableCell>
                      {record.result === '0' ? 'No Heart Disease' : 'Heart Disease Detected'}
                    </TableCell>
                  </TableRow>
                ))
              )}
            </TableBody>
          </Table>
        </TableContainer>
      </Container>
    </>
  );
}

export default UserHeartDiseaseHistory;
